 using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using OnlineBusHos133_EInvoice.Class;
using CommonModel;
using ConstData;
using Soft.Core;

namespace OnlineBusHos133_EInvoice.BUS
{
    class EInvoiceDownload
    {
        public static string B_EInvoiceDownload(string json_in)
        {

            DataReturn dataReturn = new DataReturn();
            try
            {
                EInvoiceDownload_IN _in = JSONSerializer.Deserialize<EInvoiceDownload_IN>(json_in);
                EInvoiceDownload_OUT _out = new EInvoiceDownload_OUT();
                Root root = new Root();
                
                ROOT ROOT = new ROOT();
                HEADER head = new HEADER();
                head.MODULE = "";
                head.TYPE = "INVOICEDOWNLOAD";
                head.CZLX = "";
                head.SOURCE = "ZZJ";
                ROOT.HEADER = head;
                root.ROOT = ROOT;
                Dictionary<string, string> dic = new Dictionary<string, string>();
                dic.Add("HOS_ID", FormatHelper.GetStr(_in.HOS_ID));
                dic.Add("app_id", FormatHelper.GetStr("47bfc7b48b934362b3edc81e90015d42"));//天长中
                dic.Add("invoice_code", FormatHelper.GetStr(_in.INVOICE_CODE));
                dic.Add("invoice_number", FormatHelper.GetStr(_in.INVOICE_NUMBER));
                dic.Add("invoicetype", "1");//A5
                root.BODY = dic;
                string injson = JSONSerializer.Serialize(root);
                string his_rtnxml = "";
                if (!GlobalVar.CALLSERVICE(_in.HOS_ID, injson, ref his_rtnxml))
                {
                    dataReturn.Code = 1;
                    dataReturn.Msg = his_rtnxml;
                    goto EndPoint;
                }
                Root_rtn root_rtn = JSONSerializer.Deserialize<Root_rtn>(his_rtnxml);
                string json = JSONSerializer.Serialize(root_rtn.ROOT.BODY);
                BODY body = JSONSerializer.Deserialize<BODY>(json);
                if (body.CLBZ != "0")
                {
                    dataReturn.Code = 1;
                    dataReturn.Msg = body.CLJG;
                    goto EndPoint;
                }
                _out.INVOICE_URL ="";
                _out.INVOICEFILEDATA = FormatHelper.GetStr(body.invoicefiledata);
                _out.INVENTORYFILEDATA = FormatHelper.GetStr(body.inventoryfiledata);
                dataReturn.Code = 0;
                dataReturn.Msg = "SUCCESS";
                dataReturn.Param = JSONSerializer.Serialize(_out);
            }
            catch (Exception ex)
            {
                dataReturn.Code = 6;
                dataReturn.Msg = "程序处理异常\r\n"+ex.Message;
            }
            EndPoint:
            string json_out = JSONSerializer.Serialize(dataReturn);
            return json_out;
        }
        public static string B_EInvoiceDownload_b(string json_in)
        {
            EInvoiceDownload_IN _in = JSONSerializer.Deserialize<EInvoiceDownload_IN>(json_in);
            EInvoiceDownload_OUT _out = new EInvoiceDownload_OUT();
            DataReturn dataReturn = new DataReturn();
            if (_in.INVOICE_CODE == "1")
            {
                dataReturn.Code = 6;
                dataReturn.Msg = "无明细";
            }
            else
            {
                _out.INVOICE_URL = "";
                #region
                _out.INVOICEFILEDATA = "";
                _out.INVENTORYFILEDATA = "";
                #endregion
                dataReturn.Code = 0;
                dataReturn.Msg = "SUCCESS";
                dataReturn.Param = JSONSerializer.Serialize(_out);
            }
            string json_out = JSONSerializer.Serialize(dataReturn);
            return json_out;
        }

        public class BODY
        {
            public string CLBZ { get; set; }
            public string CLJG { get; set; }
            public string invoice_url { get; set; }
            public string invoicefiledata { get; set; }
            public string inventoryfiledata{get;set;}
        }
    }
}
